    reset = () => {
        this._inbios = 1;
        this._rom = '';
        this._wram = [];
        this._eram = [];
        this._zram = [];
    }

    // Read 8-bit byte from given address
    rb = (addr) => {
        switch (addr & 0xF000) {
            // BIOS (256b) or ROM0
            case 0x0000:
                if (this._inbios)
                {
                    if (addr < 0x0100)
                        return this._bios[addr];
                    else if (CPU._r.pc === 0x0100)
                        this._inbios = 0;
                }

                return this._rom.charCodeAt(addr);

            // ROM0
            case 0x1000:
            case 0x2000:
            case 0x3000:
                return this._rom.charCodeAt(addr);

            // ROM0 (unbanked) (16k)
            case 0x4000:
            case 0x5000:
            case 0x6000:
            case 0x7000:
                return this._rom.charCodeAt(addr);

            // GRAPHIC VRAM (8k)
            case 0x8000:
            case 0x9000:
                return GPU._vram[addr & 0x1FFF];

            // EXTERNAL RAM (8k)
            case 0xA000:
            case 0xB000:
                return this._eram[addr & 0x1FFF];

            // WORKING RAM (8k)
            case 0xC000:
            case 0xD000:
                return this._wram[addr & 0x1FFF];

            // WORKING RAM SHADOW
            case 0xE000:
                return this._wram[addr & 0x1FFF];

            // WORKING RAM SHADOW, I/O, ZERO-PAGE RAM
            case 0xF000:
                switch (addr & 0x1FFF) {

                    // WORKING RAM SHADOW
                    case 0x000:
                    case 0x100:
                    case 0x200:
                    case 0x300:
                    case 0x400:
                    case 0x500:
                    case 0x600:
                    case 0x700:
                    case 0x800:
                    case 0x900:
                    case 0xA00:
                    case 0xB00:
                    case 0xC00:
                    case 0xD00:
                        return this._wram[addr & 0x1FFF];

                    // GRAPHICS: object attribute memory
                    // OAM is 160 bytes, remaining bytes read as 0
                    case 0xE00:
                        if (addr < 0xFEA0)
                            return GPU._oam[addr & 0xFF];
                        else
                            return 0;

                    // ZERO-PAGE
                    case 0xF00:
                        if (addr > 0xFF80)
                            return this._zram[addr & 0x7F];
                        else {
                            switch (addr & 0x00F0) {
                                case 0x40:
                                case 0x50:
                                case 0x60:
                                case 0x70:
                                    return GPU.rb(addr);
                            }
                            return 0;
                        }
                }
        }
    }

    rw = (addr) => {
        // Read 16-bit word from given address
        return this.rb(addr) + (this.rb(addr + 1) << 8);
    }

    wb = (addr, value) => {
        // Write 8-bit byte to a given address
        switch (addr & 0xF000) {
            // BIOS (256b) or ROM0
            case 0x0000:
            // ROM0
            case 0x1000:
            case 0x2000:
            case 0x3000:
            // ROM0 (unbanked) (16k)
            case 0x4000:
            case 0x5000:
            case 0x6000:
            case 0x7000:
                break;
            case 0x8000:
            case 0x9000:
                GPU._vram[addr & 0x1FFF] = value;
                GPU.updatetile(addr, value);
                break;

            // EXTERNAL RAM (8k)
            case 0xA000:
            case 0xB000:
                this._eram[addr & 0x1FFF] = value;
                break;

            // WORKING RAM (8k)
            case 0xC000:
            case 0xD000:
                this._wram[addr & 0x1FFF] = value;
                break;

            // WORKING RAM SHADOW
            case 0xE000:
                this._wram[addr & 0x1FFF] = value;
                break;

            // WORKING RAM SHADOW, I/O, ZERO-PAGE RAM
            case 0xF000:
                switch (addr & 0x1FFF) {

                    // WORKING RAM SHADOW
                    case 0x000:
                    case 0x100:
                    case 0x200:
                    case 0x300:
                    case 0x400:
                    case 0x500:
                    case 0x600:
                    case 0x700:
                    case 0x800:
                    case 0x900:
                    case 0xA00:
                    case 0xB00:
                    case 0xC00:
                    case 0xD00:
                        this._wram[addr & 0x1FFF] = value;
                        break;

                    // GRAPHICS: object attribute memory
                    // OAM is 160 bytes, remaining bytes read as 0
                    case 0xE00:
                        if (addr < 0xFEA0)
                            GPU._oam[addr & 0xFF] = value;
                        GPU.updateoam(addr, value);
                        break;

                    // ZERO-PAGE
                    case 0xF00:
                        if (addr > 0xFF80)
                            this._zram[addr & 0x7F] = value;
                        else {
                            switch (addr & 0x00F0) {
                                case 0x40:
                                case 0x50:
                                case 0x60:
                                case 0x70:
                                    return GPU.wb(addr, value);
                            }
                        }
                        break;
                }
                break;
        }
    }

    ww = (addr, value) => {
        // Write 16-bit word to a given address
        this._wb(addr, value & 255);
        this._wb(addr + 1, (value >> 8));
    }

